package com.gmail.jloveraulecia.appdein.Models;

public class Person {
    private Integer id=null;
    private String user ="";
    private String email ="";
    private String password="";
    private int telef1=0;
    private int telef2=0;
    private String image = "";


    public Person() {}


    public void setId(Integer id) {
        this.id = id;
    }

    public boolean setUser(String user) {
        if(user.isEmpty()){
            return false;
        }else {
            this.user = user;
            return true;
        }
    }

    public boolean setEmail(String email) {
        if(!email.contains("@")){
            return false;
        }else{
            this.email = email;
            return true;
        }
    }

    public boolean setPassword(String password) {
        if(password.length()<6){
            return false;
        }else{
            this.password = password;
            return true;
        }
    }


    public boolean setTelef1(int telef1) {
        String tel=""+telef1;
        if(tel.length()<9){
            return false;
        }else{
            this.telef1 = telef1;
            return true;
        }
    }


    public boolean setTelef2(int telef2) {
        String tel=""+telef2;
        if(tel.length()<9){
            return false;
        }else{
            this.telef2 = telef2;
            return true;
        }
    }


    public boolean setImage(String image) {
        if(image!=null){
            this.image = image;
            return true;
        }else{
            return false;
        }
    }

    public Integer getId() {
        return id;
    }

    public String getUser() {
        return user;
    }

    public String getEmail() {
        return email;
    }

    public String getPassword() {
        return password;
    }

    public int getTelef1() {
        return telef1;
    }

    public int getTelef2() {
        return telef2;
    }

    public String getImage() {
        return image;
    }
}
